// Main app component

//Module import
import React, { Component } from './node_modules/react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

//Styles import

import './App.css';

//App component
class App extends Component {
	constructor(props) {
		super(props);

		this.state = {};
	}
	render() {
		return (
			<div>
				<p>Hello world</p>
			</div>
		);
	}
}

export default App;
